import React from "react";

function MovieList(props) {
  return (
    <div className="movie__item">
      <ul>{props.movies}</ul>
    </div>
  );
}

function MovieCont({ movies }) {
  console.log(movies);
  return (
    <section className="movie__cont">
      <div className="container">
        <div className="movie__inner">
          {movies.map((movie) => (
            <MovieList />
          ))}
        </div>
      </div>
    </section>
  );
}

export default MovieCont;
